import logo from "../../images/logo.png";
import { BannerWrapper, Logo, ScrollingText, ScrollingText2, Wrapper } from "./styled";
import bg from "../../images/background.png";

export const Top = () => {
    const text = " Renowacja felg, CNC, Malowanie proszkowe, Piaskowanie ✦ ";
  return (
    <Wrapper bg={bg}>
      <Logo src={logo} />
      <BannerWrapper>
        <ScrollingText>{text}</ScrollingText>
        <ScrollingText2>{text}</ScrollingText2>
      </BannerWrapper>
    </Wrapper>
  );
};
